def tools(name,data):
    
    exefile = open(name,"wb")
    exefile.write(base64.b64decode(data))
    exefile.close()    


def open_file(name):
    file = open(name, "r")
    var = file.read()
    var = var.replace("\n"," ")
    var = var.replace("\r", " ")
    return (var)
    
        
